import { NoteType, NotesActionsTypes } from "../types/notesTypes";

export const getActiveNotes = () => {
  return getAllNotes().filter(note => !note.archived);
}

export const getArchiveNotes = () => {
  return getAllNotes().filter(note => note.archived);
}

const getTypedNotes = (notes: NoteType[]) => {
  return notes;
}
